import React from 'react'

const Welcome = () => {
  return (
    <div>
        <div className="d-flex align-items-center justify-content-center flex-column container my-10">
            <h1>Welcome to iNotebook</h1>
            <h2>Your Notes on Cloud</h2>
        </div>
      
    </div>
  )
}

export default Welcome
